    "2016-05-25T00:52:44.876880",nt"name": "host-computer-system",nt"isopen":
    true,nt"url": null,nt"notes": "The Host Computer System (HCS) receives
    and processes surveillance reports, and flight plan information.  The HCS sends
    search target, track and flight data, surveillance and alphanumeric weather information,
    time data, traffic management advisories and lists to the (Display System Replacement)
    DSR. The HCS associates surveillance-derived tracking information with flight-planning
    information.  The DSR sends requests for flight data, flight data updates, and track
    control messages to the HCS.  HCS-generated display orders are translated for use
    within the DSR workstation.  While radar data processing is distributed among the
    terminal and En Route computer resources, the HCS performs virtually all of the
    flight data processing for its entire geographical area of responsibility.  Every
    tower (ATCT) and terminal radar approach control (TRACON) relies exclusively on
    its parent HCS for flight data.",nt"license_title": "Other License Specified",nt"extras":
